function before_webhook() {
    // Does the Request contain QueryString values?  If so, assume it's a GET Request
    // and re-make the Request as a POST having moved the QueryString values into a JSON Body.
    if (method_endpoint.indexOf('?') < 0) {
        method_response = 'Attempting to set that zoom link for you...:pinktwirl:';

        var response = http_request({
            'method': 'POST',
            'url': method_endpoint + ('?=') + method_request.text,
            'headers': {
                'Content-Type': 'application/json'
            },
            'data': JSON.stringify({"text":method_request.text,"response_url":method_request.response_url})
        });

        // Returning false stops execution of the Request and sends the Response body/headers to the caller.
        return false;
    }

    // Returning true allows Cyclr to continue normal execution and gives a Response of
    // "Webhook found.".
    return true;
}

function before_action(){
  method_request.Value = method_request.Key.split('|')[1];
  method_request.Key = method_request.Key.split('|')[0].toLowerCase();
return true;
}
